import React, { useEffect, useState } from "react";
import { MapContainer, TileLayer, Marker, Popup, Polyline } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import { useLocation, useNavigate } from "react-router-dom";

export default function RouteDetails() {
  const location = useLocation();
  const navigate = useNavigate();
  const itinerary = location.state?.itinerary || [];
  const [currentIndex, setCurrentIndex] = useState(0);

  if (!itinerary.length) {
    return (
      <div>
        <h2>No itinerary found!</h2>
        <button onClick={() => navigate("/")}>Back to Home</button>
      </div>
    );
  }

  const currentPOI = itinerary[currentIndex];

  const nextPOI = () => {
    if (currentIndex < itinerary.length - 1) setCurrentIndex(currentIndex + 1);
    else alert("You have reached the end of the route!");
  };

  const finishRoute = () => {
    if (window.confirm("Are you sure you want to finish the route?")) {
      alert("Route completed!");
      navigate("/");
    }
  };

  // Prepare polyline (straight line for simplicity; can later integrate ORS)
  const routeCoords = itinerary.map(spot => [spot.lat, spot.lng]);

  return (
    <div style={{ display: "grid", gridTemplateColumns: "1fr 1fr", gap: 16 }}>
      <div style={{ height: "600px" }}>
        <MapContainer center={[currentPOI.lat, currentPOI.lng]} zoom={14} style={{ height: "100%", width: "100%" }}>
          <TileLayer
            attribution='&copy; <a href="https://www.openstreetmap.org/">OSM contributors</a>'
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          <Polyline positions={routeCoords} color="blue" />
          {itinerary.map((spot, i) => (
            <Marker key={i} position={[spot.lat, spot.lng]}>
              <Popup>
                <strong>{spot.name}</strong>
                <p>{spot.description}</p>
                {spot.image && <img src={spot.image} alt={spot.name} style={{ width: "150px", borderRadius: "8px" }} />}
                <p>Arrival: {new Date(spot.arrival).toLocaleTimeString()}</p>
                <p>Departure: {new Date(spot.departure).toLocaleTimeString()}</p>
              </Popup>
            </Marker>
          ))}
        </MapContainer>
      </div>

      <div>
        <h2>Current POI</h2>
        <p><strong>{currentPOI.name}</strong></p>
        <p>{currentPOI.description}</p>
        {currentPOI.image && <img src={currentPOI.image} alt={currentPOI.name} style={{ width: "200px", borderRadius: "8px" }} />}
        <p>Arrival: {new Date(currentPOI.arrival).toLocaleTimeString()}</p>
        <p>Departure: {new Date(currentPOI.departure).toLocaleTimeString()}</p>

        <div style={{ marginTop: 20 }}>
          {currentIndex < itinerary.length - 1 && <button onClick={nextPOI}>Next POI</button>}
          {currentIndex === itinerary.length - 1 && <button onClick={finishRoute}>Finish Route</button>}
        </div>
        <p style={{ marginTop: 20 }}>POI {currentIndex + 1} of {itinerary.length}</p>
      </div>
    </div>
  );
}
